import React, {Component} from 'react';
import {RecommendWrapper,RecommendItem} from '../style';
class Recommend extends Component {
    render(){
        return (
            <RecommendWrapper>
                <RecommendItem imgUrl="/img/banner-s-1.png">
                </RecommendItem>
                <RecommendItem imgUrl="/img/banner-s-2.png">
                </RecommendItem>
                <RecommendItem imgUrl="/img/banner-s-3.png">
                </RecommendItem>
                <RecommendItem imgUrl="/img/banner-s-4.png">
                </RecommendItem>
            </RecommendWrapper>
        )
    }
}

export default Recommend;
